import React from 'react';
import { Box, Stack, Typography, TextField } from '@mui/material';
import KeyboardCommandKeyIcon from '@mui/icons-material/KeyboardCommandKey';

function SignIN(props) {
    return (
        <div>
            <Box width="40%"  sx={{border:"1px solid",margin:"auto",marginTop:"150px",height:"40vh"}}>
                <Stack spacing={2} >
                
                <Box sx={{textAlign:"center"}}>
                      <KeyboardCommandKeyIcon/>
                </Box>
                <Box>
                     <Typography variant="h5" align='center' >Dashboard Kit</Typography>
                </Box>
                <Box>
                     <Typography variant="h5" align='center' >Login In to Dashboard Kit</Typography>
                     <Typography variant="subtitle1" align='center' >Enter your Email and Password Below</Typography>
                </Box>
               <Box>
               <TextField  label="Outlined secondary" color="secondary" focused />
               </Box>
               
             



                    </Stack> 
            </Box>
        </div>
    );      
}

export default SignIN;
